import { useState } from "react"

import Message from "../Message";

const StudentLogin = ({handleHovering}) => {
    const [username, setUsername] = useState("");
    const [groupName, setGroupName] = useState("");

    const [isError, setIsError] = useState(false);
    const [message, setMessage] = useState("");

    const clearMessage = () => {
        setIsError(false);
        setMessage("");
    }

    const handleUsername = (e) => setUsername(e.target.value);
    const handleGroupName = (e) => setGroupName(e.target.value);

    const handleLogin = (e) => {
        e.preventDefault();
        console.log(username);

    };

    return (
        <div className="flex-center-column full-container form-container"  onMouseLeave={handleHovering}>
            <h1 className="header">Member</h1>
            <Message message={message} isError={isError} clearMessage={clearMessage}/>
            <form className="full-width flex-center-column" onSubmit={handleLogin}>
                <input placeholder="Username" 
                type="text"
                value={username}
                onChange={handleUsername}/>

                <input placeholder="Group name" 
                type="text"
                value={groupName}
                onChange={handleGroupName}/>

                <button className={`login-button secondary-color`} 
                type="submit"
                onClick={handleLogin}>
                    Login
                </button>
            </form>
        </div>
    );
}


const AdminLogin = ({handleHovering, handleSignup}) => {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    const [isError, setIsError] = useState(false);
    const [message, setMessage] = useState("");

    const clearMessage = () => {
        setIsError(false);
        setMessage("");
    }

    const handleUsername = (e) => setUsername(e.target.value);
    const handlePassword = (e) => setPassword(e.target.value);

    const handleLogin = (e) => {
        e.preventDefault();
        console.log(username);

    };

    return (
        <div className="flex-center-column full-container form-container"  onMouseLeave={handleHovering}>
            <h1 className="header">Admin</h1>
            <Message message={message} isError={isError} clearMessage={clearMessage}/>
            <form className="full-width flex-center-column" onSubmit={handleLogin}>
                <input placeholder="Username" 
                type="text"
                value={username}
                onChange={handleUsername}/>

                <input placeholder="Password" 
                type="password"
                value={password}
                onChange={handlePassword}/>

                <button className={`login-button primary-color`} 
                type="submit"
                onClick={handleLogin}>
                    Login
                </button>
            </form>
            <button className="link" onClick={handleSignup}>
                Don't have an account?
            </button>
        </div>
    );
}

const AdminSignup = ({handleHovering, handleSignup}) => {
    const [email, setEmail] = useState("");
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const [repassword, setRepassword] = useState("");

